import React, {useState}from 'react'
import Offer from './components/Offer.js'

const offer = useState();

const Offers = () => {
    return (
        <div className='offersSection'>
            {
            offer.map((item,index) =>(
                <Offer 
                    key={item.image}
                    index={index}
                    src={item.image}
                    link={item.url} />
            ))}    
        </div>
    )
}

export default Offers
